import React, { useEffect } from 'react';
import './LandingPage.css'; // Assuming you will create a CSS file for styles
import { initAnimations } from '../animations/landingPage';

const LandingPage = () => {
    useEffect(() => {
        initAnimations();
    }, []);

    return (
        <div className="landing-page">
            <div className="background">
                <img src={require('../assets/stars.svg').default} alt="Stars" className="stars" />
                <img src={require('../assets/planets.svg').default} alt="Planets" className="planets" />
            </div>
            <div className="content">
                <h1 className="title">Welcome Universe</h1>
                <p className="description">Embark on an adventure through the cosmos.</p>
                <button className="cta-button" onClick={() => {/* Handle explore action */}}>
                    Explore
                </button>
            </div>
        </div>
    );
};

export default LandingPage;
